import styles from '../components/QueueManager.module.css'
import { useEffect, fetchData, useState } from 'react';
import axios from 'axios';

function QueueManager(){  
  const [jsonData, setJsonData] = useState(null);
  var apiBase = "/ibmmq/rest/v1/admin/"
  useEffect(() => {
      //fetch('https://course-api.com/react-store-products')
      fetch('http://localhost:9060'+apiBase+'qmgr')
      .then(response => response.json())
      .then(data => setJsonData(data))
      .catch(error => console.error(error));
  }, []);
  return (
    <>
    {jsonData.qmgr.map(function(obj) {
      return (
        <div key={obj.id}>
          <p>Applicant Name: {obj.name}</p>
          <p>Applicant location: {obj.state}</p>
        </div>
      )
    })}
    </>
  );
};

export default QueueManager;



